	private static void find(String[][] cities, int n) {

		Set<String> set = new HashSet<String>();
		for (int i = 1; i < n; i++) {
			set.add(cities[i][1]);
		}

		for (int i = 1; i < n; i++) {
			set.remove(cities[i][0]);
		}

		System.out.println(set.iterator().next());

	}
